import React from "react";
import { Link } from "react-router-dom";
import styled from "styled-components";

const Li = styled.li`
  flex: 1 1 30%;
  display: flex;
  flex-direction: column;
  margin: 0 1rem;
  a{
    text-decoration:none;
    color: #000;
  }
  .thum img {
    width: 100%;
  }
  .textBox {
    display: flex;
  }
  .textBox .title {
    font-size: 0.8rem;
  }
  .channelTit {
    font-size: 0.7rem;
  }
`;

function ListItems({ item, index }) {
  const { snippet } = item;
  console.log(snippet);
  return (
    <>
      <Li key={index}>

      </Li>
    </>
  );
}

export default ListItems;
